"use strict";var Base=require("./base");var JSON=require("json3");exports=module.exports=List;function List(c){Base.call(this,c);var a=this;var b=c.total;c.on("start",function(){console.log(JSON.stringify(["start",{total:b}]))});c.on("pass",function(d){console.log(JSON.stringify(["pass",clean(d)]))});c.on("fail",function(e,d){e=clean(e);e.err=d.message;e.stack=d.stack||null;console.log(JSON.stringify(["fail",e]))});c.on("end",function(){process.stdout.write(JSON.stringify(["end",a.stats]))})}function clean(a){return{title:a.title,fullTitle:a.fullTitle(),duration:a.duration,currentRetry:a.currentRetry()}};